class LiveMap {
    fun plotSpecList(): List<MutableMap<String, Any>> {
        return listOf(
            darcula().updateTiles(Tiles.productionDark),
            liveMapWithFacets(),
        ).onEach { it.updateTiles() }
    }

    private fun darcula(): MutableMap<String, Any> {
        val spec = """
            |{
            |  "kind": "plot",
            |  "data": {
            |      "x": [ 20.0, 30.0, 40.0 ],
            |      "y": [ 60.0, 60.0, 60.0 ],
            |      "s": [ 1.0, 5.0, 10.0 ],
            |      "g": [ "A", "B", "C" ]
            |  },
            |  "mapping": {
            |      "x": "x",
            |      "y": "y",
            |      "color": "g",
            |      "size": "s"
            |  },
            |  "theme": {
            |      "flavor": "darcula"
            |  },
            |  "ggtitle": {
            |      "text": "geom_livemap() + geom_point() + flavour_darcula()"
            |  },
            |  "layers": [
            |      { "geom": "livemap" },
            |      { "geom": "point" }
            |  ]
            |}
        """.trimMargin()

        return parsePlotSpec(spec)
    }

